import classes from "./Reviews.module.css";
import Button from "./UI/Button";

const rlist = [
  { rating: 5, feedback: "Great product, worth the cost", userName: "Ashwin" },
];
function Reviews() {
  return (
    <div className="container">
      <Button title="Show reviews" />
      <div>
        List of reviews
        <div>
          {rlist.map((r) => {
            return <div>{r.rating}</div>;
          })}
        </div>
      </div>
    </div>
  );
}

export default Reviews;
